import React from 'react';
import './app-footer.css'

const Footer = ()=>{
    return (<div className ="footer wraper ">
    <div className="footer-content">
       <ContactUs/> 
    </div>
</div>)
};

const ContactUs =()=>{
    return (<a href="email:piskur5809@gmail.com">ContactUs</a>)
}


export default Footer;
